CREATE TABLE empleados (
    ID_EMPLEADO INT PRIMARY KEY,
    NOMBRE VARCHAR(15),
    APELLIDO VARCHAR(15),
    EMAIL VARCHAR(15),
    TELEFONO VARCHAR(20),
    FECHA_EN VARCHAR(10),
    ID_TRABAJO VARCHAR(12),
    SALARIO DOUBLE,
    COMISION DOUBLE,
    ID_MANAGER INT,
    ID_DEPARTAMENTO INT
);

CREATE TABLE locaciones (
    ID_LOCACION INT PRIMARY KEY,
    DIRECCION VARCHAR(45),
    CODIGO_POSTAL VARCHAR(10),
    CIUDAD VARCHAR(20),
    ESTADO_PROVINCIA VARCHAR(20),
    ID_PAIS VARCHAR(2)
);

CREATE TABLE departamentos (
    ID_DEPARTAMENTO INT PRIMARY KEY,
    NOMBRE VARCHAR(22),
    ID_MANAGER INT,
    ID_LOCACION INT,
    FOREIGN KEY (ID_MANAGER) REFERENCES empleados(ID_EMPLEADO),
    FOREIGN KEY (ID_LOCACION) REFERENCES locaciones(ID_LOCACION)
);

